import React from "react";
import Navbar from "./components/Navbar";
import Hero from "./components/Hero";
import News from "./components/News"
import Recent from "./components/Recent"

function App() {
  return (
    <div>
      <Navbar />
      <Hero />
      <News />
      <Recent />
    </div>
  );
}

export default App;
